import React from "react";
import { Container, makeStyles, Typography } from "@material-ui/core";
const useStyles = makeStyles();
const App = () => {
    const classes = useStyles({
        header:{
            color:"red"
        }
    })
    return(
        <>
        <Container>
            <Typography variant='h3' align='center' className={classes.header} >Crud Operation in React </Typography>
        </Container>
        </>
    );
};

export default App;
